import { useEffect, useState } from "react";
import Axios from "axios";
import Table from "../table/Table";

function GetTable() {
  const [data, setData] = useState([]);

  const getUsers = () => {
    Axios.get("http://localhost:3001/data").then((res) => {
      setData(res.data);
      console.log(res);
    });
  };
  useEffect(() => {
    getUsers();
  }, []);

  const column = [
    { heading: "OF", value: "userName" },
    { heading: "Lot", value: "matricule" },
    { heading: "Produit", value: "role" },
    { heading: "Référence", value: "password" },
    { heading: "Référence Sorea", value: "password" },
    { heading: "Date de commande", value: "password" },
    { heading: "Qt Ddée", value: "password" },
    { heading: "Démontage", value: "password" },
    { heading: "Montage", value: "password" },
    { heading: "Qt Rebut", value: "password" },
    { heading: "Bloquage", value: "password" },
    { heading: "Zingueur", value: "password" },
  ];
  return <Table data={data} column={column} />;
}

export default GetTable;
